import React from 'react';
import { FaCheck } from 'react-icons/fa';

function PricingCard({ title, price, features, isPopular }) {
  return (
    <div className={`bg-white p-6 rounded-lg shadow-md ${isPopular ? 'border-2 border-blue-500' : ''}`}>
      {isPopular && <span className="bg-blue-500 text-white px-2 py-1 rounded-full text-sm font-semibold mb-2 inline-block">Most Popular</span>}
      <h2 className="text-2xl font-semibold mb-2">{title}</h2>
      <p className="text-4xl font-bold mb-4">${price}<span className="text-lg font-normal">/month</span></p>
      <ul className="mb-6">
        {features.map((feature, index) => (
          <li key={index} className="flex items-center mb-2">
            <FaCheck className="text-green-500 mr-2" />
            {feature}
          </li>
        ))}
      </ul>
      <button className={`w-full py-2 rounded-lg font-semibold ${isPopular ? 'bg-blue-500 text-white' : 'bg-gray-200 text-gray-800'}`}>
        Choose Plan
      </button>
    </div>
  );
}

function Pricing() {
  const plans = [
    {
      title: "Basic",
      price: 9.99,
      features: [
        "5 AI interview sessions/month",
        "Basic video analysis",
        "Limited question bank access"
      ]
    },
    {
      title: "Pro",
      price: 19.99,
      features: [
        "Unlimited AI interview sessions",
        "Advanced video analysis",
        "Full question bank access",
        "Performance tracking"
      ],
      isPopular: true
    },
    {
      title: "Enterprise",
      price: 49.99,
      features: [
        "All Pro features",
        "Custom AI training",
        "Team management",
        "Priority support"
      ]
    }
  ];

  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-4xl font-bold text-center mb-12">Pricing Plans</h1>
      <div className="grid md:grid-cols-3 gap-8">
        {plans.map((plan, index) => (
          <PricingCard key={index} {...plan} />
        ))}
      </div>
    </div>
  );
}

export default Pricing;
